import React, { Component } from "react";
import "../css/MainScreen.css";
import "../img/";
class Header extends Component {
  render() {
    return (
      <div className="row1">
        <div className="col1">
          <div className="logo-header">
            <img id="logo" src="../img/Logo.png" />
          </div>
        </div>
      </div>
    );
  }
}

export default Header;
